import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let crnDate = new Date(2021, 8, 13, 2);
crnDate = crnDate.getHours();
let greeting = "";
let cssStyle = "";

if(crnDate >= 1 && crnDate <12){
  greeting = "Good Morning";
  cssStyle.color = "red"
}else if (crnDate >= 12 && crnDate < 19){
  greeting = "Good Afternon";
  cssStyle.color = "blue"
}else{
  greeting = "Good Night";
  cssStyle.color = "green"

}


ReactDOM.render(
  <>
  <h1>Hellow!! {greeting} </h1>
  </>,

  document.getElementById("root")

);
